local bytBuf = ""
local bitBuf = ""
local function getByte()
 if bytBuf == "" then
  bytBuf = D.read(instHandle, 64)
 end
 local r = bytBuf:byte()
 bytBuf = bytBuf:sub(2)
 return r
end
while true do
 if getByte() == 0 then break end
end
local function pb(c, p) if c % (p * 2) ~= c % p then bitBuf = bitBuf .. "1" else bitBuf = bitBuf .. "0" end end
local stn = 0
local function getBit()
 if bitBuf == "" then
  local c = getByte()
  c = (c - stn) % 256 stn = stn + 3
  pb(c, 1)
  pb(c, 2)
  pb(c, 4)
  pb(c, 8)
  pb(c, 16)
  pb(c, 32)
  pb(c, 64)
  pb(c, 128)
 end
 local bit = bitBuf:sub(1, 1) == "1"
 bitBuf = bitBuf:sub(2)
 return bit
end
local buf = ""
local mode = false
local bc2 = 10
while true do
 local bc = getBit()
 local v = 0
 if bc then bc = bc2 v = 64 else bc = 6 end
 for bit = 0, bc - 1 do
  if getBit() then v = v + (2 ^ bit) end
 end
 buf = buf .. syms[v]
 if mode then
  while #buf >= 512 do
   sector(buf:sub(1, 512))
   buf = buf:sub(513)
  end
 else
  if #buf == 27939 then
   stn = 0
   bc2 = 11
   bitBuf = ""
   syms = {}
   while #buf > 0 do
    local len = buf:byte()
    if len > 127 then error("symlen") end
    buf = buf:sub(2)
    local ch = buf:sub(1, len)
    buf = buf:sub(len + 1)
    table.insert(syms, ch)
   end
   mode = true
  end
 end
end
